import React from 'react';
import Navbar from './Navbar';
import './App.css';
import Card from './Card';
import Stories from './Stories';


function App() {
  return (
    <div>
      <div className="navbar">
        <Navbar />
      </div>
      <div className="feed">
        <Card />
      </div>
      <div className="sideBar">
        <Stories />
      </div>
    </div>
  )
}


export default App;
